window.bookSummaryJSON = "<p><b>I’m starting over.</b></p> <p>Moving to a new town to start college, where I can try to be normal. Or at least pretend I am.</p> <p>I’m willing to fake it, because I’m tired of trying to get better. Tired of spilling my guts to doctors and therapists to understand why I’ve heard voices since I was a child.</p> <p>The meds are working...for now, but if they stop, I’ll never tell. I just want to live my life, and if that means ignoring why so many people think I’m crazy, so be it.</p> <p><b>She’s the most silent storm I’ve ever witnessed.</b></p> <p>Waylynn is as pretty as a picture, curvy, with hazel eyes that always seem to evade everyone’s gaze.</p> <p>She’s been avoiding me since our first encounter, but fate intervenes and brings her right back to me...and my brother.</p> <p>Now I need to know more.</p> <p><b><i>Seeing Sound</i></b><b> is the first book of the Tasting Madness series. This is a reverse-harem novel with adult themes and situations.</b></p>"; 
